import React, { Component } from 'react'
import NSFields from '../components/NSFields/index'

export default {
  title: 'New Story Fields',
  component: NSFields
}

export function NSFieldsContainer() {

  const Prefix = () => <p style={{ minWidth: 50 }}>TEST-FAMILY-</p>;

  return (
    <div>
      <NSFields 
        fieldType="short_text"
        field="shortText"
        label="Short Text"
        position="start"
        showPrefix
        icon={Prefix}/>
    </div>
  )
}
